import React from 'react';
import { Box, Typography } from '@mui/material';

const Explore = () => {
  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        探索新角色
      </Typography>
      <Typography variant="body1">
        更多角色即将推出...
      </Typography>
    </Box>
  );
};

export default Explore;
